import React from "react";
import SocialIcons from "../component/SocialIcons";

export default function Home() {
  return (
    <div>
      <img></img>
      <h3>Anish Hegde</h3>
      <p>Frontend Developer</p>
      <div>
        <SocialIcons />
      </div>
      <div>
        <a href="">Project</a>
        <a href="">About</a>
      </div>
    </div>
  );
}
